  false,\n\t\"url\": null,\n\t\"notes\": \"The yellow warbler and willow flycatcher
  are focal species for the Refuge and its habitat is highly tied to land management
  (mowing), irrigation, and river management. Point counts are an efficient method
  for monitoring a variety of other landbird species as well. Assess trend in relative
  abundance and composition of landbird species in woody riparian habitat in Unit
  12. This survey will help address the question related to usefulness of coyote willow
  as suitable habitat. Areas dominated by this species will be included in the selection
  of point locations.  Determine whether bird populations respond positively to increased
  acreage of woody riparian habitat. Data will be contributed to the Avian Knowledge
  Network for use in regional analysis.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
